INSERT INTO `SHOP` (`ID`,`ANGLE`,`CATEGORY`,`DAYFIVECLOSE`,`DAYFIVEOPEN`,`DAYFOURCLOSE`,`DAYFOUROPEN`,`DAYNULLCLOSE`,`DAYNULLOPEN`,`DAYONECLOSE`,`DAYONEOPEN`,`DAYSIXCLOSE`,`DAYSIXOPEN`,`DAYTHREECLOSE`,`DAYTHREEOPEN`,`DAYTWOCLOSE`,`DAYTWOOPEN`,`DESCRIPTION`,`EMAIL`,`GOOGLEPLACEID`,`HOUSENUMBER`,`NAME`,`PHONE`,`RATING`,`STREET`,`UPDATED`,`WEBSITE`,`X`,`Y`,`CITYINFO`,`USER_USERNAME`,`FACEBOOKURL`,`FBVISITS`,`INSTAVISITS`,`INSTAGRAMURL`,`NEEDGOOGLE`,`VISITS`) VALUES (240,-30,'CUCA',1800,830,1800,830,930,930,1800,830,1800,930,1800,830,1800,830,'Kære Ven\nRøde Roses Kaffebar glæder sig til at invitere dig til Balders Plads på Ydre Nørrebro. Her får du serveret kaffe med hjerte på et sted, der mest af alt ligner køkkenet hos en go ven. Vi bor på en af de bedste og smukkeste pladser i København med en dejlig legeplads lige overfor cafeen\n\nVi laver alt lige fra tapas og tude-cortado til chevre chaud og cheesecake - spørg, hvis der er noget du mangler. Alt kan lade sig gøre - bare der ikke er nogen der kommer til skade.\n\nvi ses\n\nTue og Anne','tulu@me.com','ChIJgSzx_lFSUkYRZBJekmKLKsI','65','Røde Roses','+45 20 28 70 19',4.1,'Baldersgade',NULL,'http://www.facebook.com/rrkaffebar/?fref=ts',62.4,19,'2200',NULL,'http://www.facebook.com/rrkaffebar/?fref=ts',NULL,NULL,NULL,1,NULL);
