INSERT INTO `SHOP` (`ID`,`ANGLE`,`CATEGORY`,`DAYFIVECLOSE`,`DAYFIVEOPEN`,`DAYFOURCLOSE`,`DAYFOUROPEN`,`DAYNULLCLOSE`,`DAYNULLOPEN`,`DAYONECLOSE`,`DAYONEOPEN`,`DAYSIXCLOSE`,`DAYSIXOPEN`,`DAYTHREECLOSE`,`DAYTHREEOPEN`,`DAYTWOCLOSE`,`DAYTWOOPEN`,`DESCRIPTION`,`EMAIL`,`GOOGLEPLACEID`,`HOUSENUMBER`,`NAME`,`PHONE`,`RATING`,`STREET`,`UPDATED`,`WEBSITE`,`X`,`Y`,`CITYINFO`,`USER_USERNAME`,`FACEBOOKURL`,`FBVISITS`,`INSTAVISITS`,`INSTAGRAMURL`,`NEEDGOOGLE`,`VISITS`) VALUES (314,45,'BEER',100,1100,100,1100,1100,1100,100,1100,200,1100,100,1100,100,1100,'Café Stefanshus er legepladsen for de voksne. Der er 3 Billardborde og 2 Poolborde, Dart og Bordfodbold.\n\nTag måske computeren med og benyt dig af det gratis internet, nyd solen i gårdhaven.\n\nEller lav en aftale med vennerne til en pot billard.\n\nHvis sulten skulle melde sig, er det helt Ok at tage en pizza eller sandwich med.',NULL,'ChIJbe_vurJTUkYRlRcv2TIqVOY','22','Stefanshus','+45 35 85 58 22',4,'Stefansgade',NULL,'http://www.kiowa.dk/stefanshus/',29.4,26.2,'2200',NULL,NULL,NULL,NULL,NULL,1,NULL);
INSERT INTO `SHOP` (`ID`,`ANGLE`,`CATEGORY`,`DAYFIVECLOSE`,`DAYFIVEOPEN`,`DAYFOURCLOSE`,`DAYFOUROPEN`,`DAYNULLCLOSE`,`DAYNULLOPEN`,`DAYONECLOSE`,`DAYONEOPEN`,`DAYSIXCLOSE`,`DAYSIXOPEN`,`DAYTHREECLOSE`,`DAYTHREEOPEN`,`DAYTWOCLOSE`,`DAYTWOOPEN`,`DESCRIPTION`,`EMAIL`,`GOOGLEPLACEID`,`HOUSENUMBER`,`NAME`,`PHONE`,`RATING`,`STREET`,`UPDATED`,`WEBSITE`,`X`,`Y`,`CITYINFO`,`USER_USERNAME`,`FACEBOOKURL`,`FBVISITS`,`INSTAVISITS`,`INSTAGRAMURL`,`NEEDGOOGLE`,`VISITS`) VALUES (315,45,'TAWA',2200,1100,2200,1100,1100,1100,2200,1100,2200,1100,2200,1100,2200,1100,'Ibrahim Kaya åbenede i sommeren år 2000, Stefanos pizza efter at have fået stor succes med Stefanos delikateser som også ligger på stefansgade.\nDer vandt han københavns kommune erhverspris for årets butik og nomineret 2 år i træk og vandt også prisen som miljøambassadører for kvarterløftprojektet.\nHan har efterfølgende åbnet stefanos grønne hjørne, da efterspørgelsen på økologiske dagligvarer, blev mere efterspurgte i de danske køkkener.','stefanos@live.dk','ChIJU1TUvLJTUkYRmK0yrL7Jszc','33','Stefanos','+45 35 82 61 64',4.2,'Stefansgade',NULL,'http://www.stefanospizza.dk/',30.6,25.3,'2200',NULL,'https://www.facebook.com/Stefanos-pizza-1655971534',NULL,NULL,'https://www.instagram.com/stefanospizza/',1,NULL);
